import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import { Navigation, Buttons, Boxes, Popups } from '../../components';

const OnGoing = () => {
  const navigate = useNavigate();
  const [popupVisible, setPopupVisible] = useState(false);

  const handleOnGoingClick = () => {
    navigate('/menu-overview');
  };

  const togglePopup = () => {
    setPopupVisible(popupVisible);
  }

  return (
    <div>
      <div className='flex items-center justify-between w-full mb-5 px-5 pt-20'>
        <Buttons context='back' onClick={handleOnGoingClick}/>
        <h1 className='text-black text-2xl'>On Going</h1>
      </div>

      <Boxes className='mb-2.5' onOrderReceived={togglePopup}></Boxes>

      <Navigation></Navigation>

      <Popups type="order_completed" visible={popupVisible} />
    </div>
  );
};

export default OnGoing;
